export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},sZE1ROa1J7:{data:{id:1559,attributes:{imdbId:"tt0076172",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjE0OWUyMjYtOTQ4ZC00NzM0LTk3NjktOWE0YmI2OWYxM2JhXkEyXkFqcGdeQXVyNDkzNTM2ODg@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"}],item_lang:{data:{id:2222,attributes:{title:b,plot:"Based very loosely on the intricate novel by Joanne Greenberg. A young woman's devotion to a childhood fantasy kingdom has taken over her entire life and causes her endless pain and degradation. Placed in a mental hospital, she has the great good fortune to have a truly caring therapist who tries to help her accept reality, even though reality isn't so great either.",slug:"i-never-promised-you-a-rose-garden"}}},books:{data:[{id:8170,attributes:{title:b,description:"The multimillion-copy bestselling modern classic of autobiographical fiction about a young woman’s struggle with mental health, featuring a new foreword by Esmé Weijun Wang, the New York Times bestselling author of The Collected Schizophrenias, and a new afterword by the author A Penguin Classic After making an attempt on her own life, sixteen-year-old Deborah Blau is diagnosed with schizophrenia. With the reluctant and fearful consent of her parents, she enters a psychiatric hospital many hours from her home in suburban Chicago. Here she will spend the next three years, trying, with the help of a gifted psychiatrist, to find a path back to her “normal” life, and to emerge from the imaginary Kingdom of Yr in which she has sought refuge. A semiautobiographical novel originally published under the pen name Hannah Green just a year after Sylvia Plath’s The Bell Jar--a very different portrait of psychological breakdown--I Never Promised You a Rose Garden remains, more than half a century later, a timeless and ultimately hopeful book, ripe for rediscovery by a new generation eager to erase the stigma of mental illness.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xphPEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:true,published:"2022-05-03",publisher:"Penguin",subtitle:h}},{id:8171,attributes:{title:b,description:"The classic novel about a young woman's struggle against madness, now a Holt Paperback, with a new afterword by the author Hailed by The New York Times as \"convincing and emotionally gripping\" upon its publication in 1964, Joanne Greenberg's semiautobiographical novel stands as a timeless and unforgettable portrayal of mental illness. Enveloped in the dark inner kingdom of her schizophrenia, sixteen-year-old Deborah is haunted by private tormentors that isolate her from the outside world. With the reluctant and fearful consent of her parents, she enters a mental hospital where she will spend the next three years battling to regain her sanity with the help of a gifted psychiatrist. As Deborah struggles toward the possibility of the \"normal\" life she and her family hope for, the reader is inexorably drawn into her private suffering and deep determination to confront her demons. A modern classic, I Never Promised You a Rose Garden remains every bit as poignant, gripping, and relevant today as when it was first published.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=z2Yz2KEwliEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2009-01-06",publisher:"Holt Paperbacks",subtitle:f}},{id:8172,attributes:{title:b,description:"Enveloped in the dark inner kingdom of her schizophrenia, sixteen-year-old Deborah is haunted by private tormentors that isolate her from the outside world. With the reluctant and fearful consent of her parents, she enters a mental hospital where she will spend the next three years battling to regain her sanity with the help of a gifted psychiatrist. As Deborah struggles toward the possibility of the “normal” life she and her family hope for, the reader is inexorably drawn into her private suffering and deep determination to confront her demons. A modern classic, I Never Promised You a Rose Garden remains every bit as poignant, gripping, and relevant today as when it was first published.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0VInmQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:e,published:"2008-12-30",publisher:"St. Martin's Paperbacks",subtitle:f}},{id:8173,attributes:{title:b,description:"A young girl retreats from the real world into a world of fantasy and madness.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OczMHlWYU34C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Hannah Green"],firstBook:e,published:"1989-01-01",publisher:h,subtitle:f}},{id:8174,attributes:{title:"Where the Road Goes",description:"A masterful novel about the complicated ties that bind families together and the love that has the power to drive them apart.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B_AdGa3PBF4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2011-04-01",publisher:"Henry Holt and Company",subtitle:f}}]}}},meta:{}}},prerenderedAt:1688531362689}}("movie","I Never Promised You a Rose Garden","series","Joanne Greenberg",null,"A Novel",1,""))